import React from 'react';

const Skills = () => {
  return (
    <section className="skills" id="skills">
      <div className="glass-effect">
        <h2>My Skills</h2>
        <ul>
          <li>3D Modeling</li>
          <li>Animation</li>
          <li>Technical Support</li>
          <li>Game Development</li>
        </ul>
      </div>
    </section>
  );
};

export default Skills;
